import React from 'react';
import '../App.css';
import Header from './common/Header';
import Footer from './common/Footer';

const Home = () => {
  return (
    <div className="body">
      <div className="App">
        <Header />
        <Footer />
      </div>
    </div>
  );
};
export default Home;
